import React, { Component } from 'react'
import { Menu } from '@material-ui/core';
import colorPalleteIcon from '../svg_icons/colorPallete.svg'


export default class ColorComponent extends Component {
    constructor(){
        super();
        this.state={
            menuOpen:false,
            anchorEl:null,
            colors:[
                {value:"#fff"},
                {value:"#f28b82"},
                {value:"#fbbc04"},
                {value:"#fff475"},
                {value:"#ccff90"},
                {value:"#a7ffeb"},
                {value:"#cbf0f8"},
                {value:"#aecbfa"},
                {value:"#d7aefb"},
                {value:"#fdcfe8"},
                {value:"#e6c9a8"},
                {value:"#e8eaed"},

            ]
        }
    }


    handleMenu = e =>{
        this.setState({
            menuOpen:true,
            anchorEl:e.target
        })

    }

    handleClose = e =>{
        this.setState({
            menuOpen: !this.state.menuOpen,
            anchorEl: this.state.anchorEl
        })
    }

    render() {

        const colorPalette = this.state.colors.map((colorp)=>{
            return <div>{colorp.value}</div>
        })
        return (
            <div>
                <img 
                aria-controls="menu-appbar"
                aria-haspopup="true"
                onClick={this.handleMenu} 
                src={colorPalleteIcon}
                alt="colorPalleteIcon" />

                <Menu
                anchorOrigin={{
                    vertical: 'top',
                    horizontal: 'right',
                  }}
                  transformOrigin={{
                    vertical: 'bottom',
                    horizontal: 'right',
                  }}
                id="menu-appbar"
                anchorEl={this.state.anchorEl}
                open={this.state.menuOpen}
                onClose={this.handleClose}
                >
                    {colorPalette}
                </Menu>
            </div>
        )
    }
}
